El docente investigador de la Universidad del Sinú -Elías Bechara Zainúm-, Heiser Arteaga Pautt, fue designado por el alcalde de Montería, Carlos Ordosgoitia Sannín, como gerente de Vacunación contra el Covid-19 en la capital del departamento de Córdoba.

El nombramiento es un reconocimiento público a la tarea que viene desarrollando este profesional, quien desde inicios de la actual emergencia sanitaria ha hecho parte del Comité Técnico Científico del Municipio y también, a la contribución de esta Alma Máter a la lucha contra la pandemia en la ciudad, a través de la investigación científica orientada al estudio del fenómeno.
Arteaga Pautt manifestó que desde este cargo se seguirán coordinando las acciones necesarias para que Montería siga avanzando en la ejecución del Plan Nacional de Vacunación establecido por el Ministerio de Salud y que seguirá siendo de vital importancia el apoyo de la academia.
