La Universidad del Sinú Elías Bechara Zainúm acogió la jornada de  socializacion de la Ley  Emprendimiento, liderada por @innpulsacol que tiene como aliada en la región a nuestra Alma Mater.

El presidente de Innpulsa, Ignacio Gaitán Villegas destacó el liderazgo de Unisinú en el ecosistema de emprendimiento del departamento de Córdoba, siendo la sede del primer satélite CEmprende en esta zona del país.

La rectora de Sede Montería Adriana Suárez de Lacouture, agradeció al Gobierno Nacional su apuesta por el emprendimiento y la innovación de la mano de la académia.
