Nuestra Rectora General, doctora Ilse Bechara Castilla, fue exaltada por la Gobernación de Córdoba en el marco de la conmemoración del DíaDeLaMujer, en un acto especial celebrado en la ciudad de Montería

El Gobernador Orlando Benítez Mora y la gestora social Marta Ruiz Solera, la distinguieron en el marco de la campaña #MujerInvencible2021, que lidera el Gobierno Departamental.

La doctora Bechara Castilla, a quien se le reconoció su liderazgo y trayectoria en el sector de la educación superior al frente de la Universidad del Sinú, fue distinguida junto a un grupo de mujeres líderes en distintos campos de vida social, cultural, artística, pública y privada de Córdoba.

Felicitaciones a nuestra Rectora General.👏
