El Consejero Presidencial para la Juventud, Juan Sebastián Arango visitó el stand de nuestra Alma Mater durante el desarrollo de la feria #ExpoJovenCórdoba2021 que organiza la @gobcordoba
Lo acompañan el doctor José Fernando Acosta, jefe de programa de Administración de Empresas, la doctora María Paz Díaz, Secretaria de Juventud Departamental, la doctora Samia Farah Quiroz, Directora de Mercadeo de Unisinú y el doctor Freddy Sánchez Kerguelen, Director Oficina de Desarrollo Económico y Emprendimiento de la Alcaldía de Montería.
